.gDicClassPopupBox[onpopuphidden] {
    -moz-appearance: none !important;
    opacity: 0 !important;
    visibility: collapse !important;
    transition-property: opacity, visibility, display !important;
    transition-duration: 1900ms, 0s, 0s !important;
    transition-timing-function: ease-in-out !important;
    transition-delay: 0s, 1900ms, 1900ms !important;
}
.gDicClassPopupBox[onpopupshown] {
    -moz-appearance: none !important;
    opacity: 1 !important;
    visibility: visible !important;
    transition-property: opacity, visibility, display !important;
    transition-duration: 1900ms, 0s, 0s !important;
    transition-timing-function: ease-in-out !important;
    transition-delay: 0s, 0s, 0s !important;
}


.gDicClassPopupBox {
    -moz-appearance: tooltip !important;
    background: none no-repeat scroll 0px 0px transparent !important;
    border: 0px none transparent !important;
    margin: -10px 0px 0px -30px !important;
    padding: 7px !important;
}

/*  ----  */
.gDicClassPopup {
    -moz-appearance: none !important;
     -moz-window-shadow: none !important;
    min-width: 280px !important;
    padding: 3px !important;
    border: 1px solid hsl(210,11%,10%) !important;
    border-radius: 4px !important;
    box-shadow:
        0 1px 0 hsla(209,29%,72%,.25) inset,
        0px 1px 5px 2px rgba(0,0,0,0.7)
        !important;
    background-color: transparent !important;
    background-image:
        linear-gradient(to bottom,
            hsl(209,18%,18%),
            hsl(210,11%,16%)
            ) !important;
    color: rgb(210,210,210) !important; 
}/*  ----  */
/*  ----  */
.gDicClassPopupOrig{
    color: rgb(255,186,2) !important; 
    font-weight: bold;
    font-size: 15px;
    text-transform: uppercase !important;}
.gDicClassPopupTrans {
    color: cyan !important;
    font-size: 15px !important;
    margin: 0px 10px 0px 0px !important;
    text-transform: uppercase !important;}
